import React from 'react';
import Logo from '../components/Logo';


const Home = () => {
    return (
        <>
            <Logo />
            <div className="home">
                <h2>Bienvenue sur la premier plateforme de prestation de services du sénégal.</h2>
                <br />
                <h1> Ici vos besoins sont nos missions </h1>
                <br />
                <h3>Trouvez le prestataire idéal pour tous vos services du quotidien</h3>
            </div>
            <div className='services'>
                <img src="./img/maçon.JPG" alt="" />
                <img src="./img/decoration.JPG" alt="" />
                <img src="./img/carlage.JPG" alt="" />
                <img src="./img/Education.jpeg" alt="" />
                <img src="./img/menusier.JPG" alt="" />
                <img src="./img/peintre.jpeg" alt="" />
                <img src="./img/metalique.jpeg" alt="" />
                <img src="./img/electricien.JPG" alt="" />

            </div>


            <div className='btn'>
                <button type="button" >Light</button>
            </div>



        </>
    );
};

export default Home;
